  const userID = [{ goal: "Jose" }, { goal: "Rosa" }, { goal: "Neus" }];

  return (
    <div>
      <Header></Header>
      <MainWrapper class="forum-container">
        <TopicCard goal={data[0].goal} userID={data[0].goal}></TopicCard>
        <TopicCard goal={data[1].goal}></TopicCard>
        <TopicCard goal={data[2].goal}></TopicCard>
      </MainWrapper>
      <Footer></Footer>
    </div>
  );
}

export default Forum;
